import axios from "axios";

const jsonPlaceholder = () => {
    return axios.create({
        baseURL: "https://jsonplaceholder.typicode.com",
    });
};

export const getPosts = this.jsonPlaceholder.get("/posts");

export default jsonPlaceholder;
